import {gql} from '@apollo/client'

export const NEW_USER = 
gql`
    mutation insertNewUser (
        $username : String!,
        $full_name : String!,
        $email :String!,
        $password : String!,
        $is_google : Boolean!,
        $is_verified : Boolean!
    ){
        register(input:{
            username : $username,
            full_name : $full_name
            email : $email,
            password : $password,
            is_google : $is_google,
            is_verified : $is_verified
        })  	
    } 
`

export const UPDATE_USER =
gql`
    mutation updateUser(
        $id :String!,
        $username :String!,
        $email : String!,
        $password : String!,
        $is_google :Boolean!
    ){
        updateUser(id : $id, 
        input:{
        username : $username,
        email : $email,
        password: $password,
        is_google : $is_google
        })
        
        {
        username,
        email,
        password,
        is_google
        }
    }

`

export const DELETE_USER = 
gql`
    mutation deleteUser (
        $id : String!
    ){
        deleteUser(id : $id)
    }
`


export const LOGIN_USER = 
gql`
    mutation LoginUser(
        $username : String!,
        $password : String!
    )
    {
        login(input:{
        user_or_email : $username,
        password :$password
        })  
    }
`

export const LOGIN_GOOGLE = gql`
  mutation LoginGoogle($accessToken: String!) {
    loginGoogle(access_token: $accessToken)
  }
`;



export const VERIFY_USER = 
gql`
    mutation verifyUser(
        $token :String!,
        $email :String!
    ){
        verifyUser(input:{
        token :$token,
        email :$email
        })
    }
`

export const RESEND_VERIFY = 
gql`
    mutation resendVerification(
        $email : String!
    ){
        resendVerification(input:{
        email: $email
        })
    }
`

export const SEND_GMAIL_RESET  =
gql`
    mutation sendGmailOnReset ($email :String!){
        sendGmailOnReset(email: $email)
    }
`

export const RESET_PASSWORD = 
gql`
    mutation resetPassword(
    $token :String!,
    $password :String!
    )
    {
    resetPassword(input:{
        token :  $token,
        password :$password
    })
    }
`


export const GET_USER =gql`
mutation getUser($token :String!){
  sendUserBasedOnJWT(token : $token)
  {
    user_id
    username
    full_name
    email
	  password
    	
  	mutual_users{
      username
      profile_picture
      
    }
  }

}
`

export const SEARCH_USER = 
gql`
mutation search ($username :String!){
  sendUserBasedOnUsername(username: $username)
    {
      user_id
      username
      email
      password
      full_name
      
      saved_post{
        post_id
      }
      
      tagged_post{
        post_id
      }
      
    }
}

`

export const GET_FOLLOW_STATUS = 
gql`
mutation getFollowStatus($id :ID!, $targetId :ID!){
    getFollowStatus(id:$id, targetId:$targetId)
  }
`

export const FOLLOW = 
gql`
mutation follow($id :ID!, $targetId :ID!){
    follow(id:$id, targetId:$targetId)
  }
`

export const UNFOLLOW = 
gql`
mutation unfollow($id :ID!, $targetId :ID!){
    unfollow(id:$id, targetId:$targetId)
  }
`


export const ADD_POST = gql`
    mutation postAdd($input:NewPost!){
        addNewPost(input:$input){
            id
            caption
        }
